import Vue from "vue";
import Router from "vue-router";

Vue.use(Router);

export default new Router({
  routes: [
    {
      path: "/order",
      component: Order,
      children: [
        {
          path: "product",
          component: Product,
        },
      ],
    },
  ],
});
